import styled from 'styled-components'

export const AppContainer = styled.div`
    height: 100vh;
    width: 100%;
    display: grid;
    grid-template-columns: 1fr;
    grid-template-rows: 60px 1fr 50px;
`;

export const MainContainer = styled.main`
   display: flex;
   justify-content: center;
`;
